import classes from './Radio.module.css'

function Radio(props) {
	return (
		<div>
			<label>
				<input type='radio' name={props.name} id={props.id} onChange={props.onChange}/> 
				<span>
					{props.text}
				</span>
			</label>
		</div>
	);
}

export default Radio;
